//     <header className="header">
//       <div className="logo">
//         <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.shutterstock.com%2Fsearch%2Fblood-drop-background&psig=AOvVaw1RIKy52IAJ-QWv4nIzuvPe&ust=1734333820909000&source=images&cd=vfe&opi=89978449&ved=0CBQQjRxqFwoTCMCRsI6fqYoDFQAAAAAdAAAAABAE" alt="" />
